import {Link} from 'react-router-dom';

const Navbar = () => {
    return ( 
        <nav className="navbar">
            <h1>Nerds' Blog</h1>
            <div className="links">
                <Link href="/">Home</Link>
                <a href="/create">Create</a>
            </div>
        </nav>
     );
}

export default Navbar;
